        <style>
            :root {
                --structure-node-level: 1;
                --button_width: 70px;
                --button_height: 30px;
                --margin_button_bottom: 30px;
                --margin_onoff_button_left: 15px;
                --margin_dir_button_hori: 10px;
                --margin_dir_button_top: 20px;
                --slidebar_width: 50vw;
                --slidebar_height: 10px
            }

            body {
                width: 100%;
                height: 100%;
                margin: 0 auto;
                touch-action: none;
                -moz-user-select: none;
                -webkit-user-select: none;
                -ms-user-select: none;
                user-select: none;
                overflow: hidden
            }

            canvas {
                z-index: 0;
                display: block;
                position: absolute;
                width: 100%;
                height: 100%;
                margin: 0 auto
            }

            .structure_panel {
                z-index: 1;
                display: block;
                position: absolute;
                visibility: hidden;
                white-space: nowrap;
                width: 20vw;
                top: 50px;
                bottom: 0;
                left: 0;
                overflow-y: auto;
                overflow-x: auto;
                background-color: rgba(154,189,229,.6)
            }

            .node_normal {
                box-sizing: border-box;
                padding-top: 5px;
                padding-bottom: 5px;
                padding-left: calc(15px * var(--structure-node-level))
            }

            .node_select {
                box-sizing: border-box;
                padding-top: 5px;
                padding-bottom: 5px;
                padding-left: calc(15px * var(--structure-node-level));
                background-color: rgba(0,0,255,.6)
            }

            .node_select_parent {
                box-sizing: border-box;
                padding-top: 5px;
                padding-bottom: 5px;
                padding-left: calc(15px * var(--structure-node-level));
                background-color: rgba(134,169,255,.6)
            }

            .open_button_region {
                width: 15px;
                display: inline-block
            }

            .node_normal_close {
                width: 10px;
                height: 10px;
                background-color: #000;
                clip-path: polygon(50% 0,100% 50%,50% 100%);
                display: inline-block
            }

            .node_normal_open {
                width: 10px;
                height: 10px;
                background-color: #000;
                clip-path: polygon(0 20%,100% 20%,50% 70%);
                display: inline-block
            }

            .node_select_close {
                width: 10px;
                height: 10px;
                background-color: #fff;
                clip-path: polygon(50% 0,100% 50%,50% 100%);
                display: inline-block
            }

            .node_select_open {
                width: 10px;
                height: 10px;
                background-color: #fff;
                clip-path: polygon(0 20%,100% 20%,50% 70%);
                display: inline-block
            }

            .normal_string {
                color: #000
            }

            .select_string {
                color: #fff
            }

            .property_panel {
                z-index: 1;
                display: block;
                position: absolute;
                overflow-wrap: break-word;
                visibility: hidden;
                width: 20vw;
                top: 50px;
                bottom: 0;
                right: 0;
                padding-left: 5px;
                overflow-y: auto;
                overflow-x: hidden;
                background-color: rgba(154,189,229,.6);
                -moz-user-select: text;
                -webkit-user-select: text;
                -ms-user-select: text;
                user-select: text
            }

            .property_title {
                padding-top: 10px;
                padding-left: 5px;
                font-weight: 700
            }

            .property_data {
                padding-top: 5px;
                padding-left: 10px
            }

            input {
                z-index: 2;
                position: absolute
            }

            .clip_btn_onoff {
                width: var(--button_width);
                height: var(--button_height);
                left: var(--margin_onoff_button_left);
                bottom: var(--margin_button_bottom)
            }

            .clip_btn_front {
                width: var(--button_width);
                height: var(--button_height);
                left: calc(50vw - var(--button_width) * .5 - var(--margin_dir_button_hori) - var(--button_width));
                bottom: var(--margin_button_bottom)
            }

            .clip_btn_side {
                width: var(--button_width);
                height: var(--button_height);
                left: calc(50vw - var(--button_width) * .5);
                bottom: var(--margin_button_bottom)
            }

            .clip_btn_top {
                width: var(--button_width);
                height: var(--button_height);
                left: calc(50vw + var(--button_width) * .5 + var(--margin_dir_button_hori));
                bottom: var(--margin_button_bottom)
            }

            .clip_slidebar {
                width: var(--slidebar_width);
                height: var(--slidebar_height);
                left: calc(50vw - var(--slidebar_width) * .5);
                bottom: calc(var(--margin_button_bottom) + var(--button_height) + var(--margin_dir_button_top))
            }

            .loading {
                z-index: 3;
                display: block;
                position: absolute;
                background: #333;
                width: 100%;
                height: 100%;
                margin: 0 auto
            }

            .loading .spinner {
                z-index: 4;
                display: block;
                position: absolute;
                top: 40%;
                left: calc(50vw - 25px);
                width: 50px;
                height: 50px;
                margin: 0 auto;
                border-radius: 50px;
                border: 7px solid #444;
                border-top: 7px solid #f0f0f0;
                animation: loading .8s linear 0s infinite
            }

            @keyframes loading {
                from {
                    transform: rotate(0)
                }

                to {
                    transform: rotate(360deg)
                }
            }

            .loading.hide {
                opacity: 0;
                pointer-events: none;
                transition: opacity .5s
            }

            .spinner.hide {
                opacity: 0;
                pointer-events: none;
                transition: opacity .5s
            }

            .appname {
                z-index: 5;
                pointer-events: none;
                display: block;
                position: absolute;
                top: 0;
                left: 0;
                right: 0;
                height: 50px;
                padding-left: 15px;
                line-height: 50px;
                font-family: Arial;
                font-size: 18pt;
                font-weight: 700
            }

            .appname.loading_color {
                color: #f0f0f0
            }

            .appname.model_color {
                background-color: rgba(154,189,229,.65);
                color: #ae1e31;
                transition: color .5s
            }

            .help_button {
                z-index: 6;
                display: block;
                position: absolute;
                visibility: hidden;
                top: 5px;
                right: 10px;
                height: 40px;
                width: 40px;
                border-radius: 40px;
                border: 1px solid #e9e9e9;
                color: #e9e9e9;
                line-height: 40px;
                text-align: center;
                font-size: 18pt
            }

            .help_background {
                z-index: 7;
                display: block;
                position: absolute;
                visibility: hidden;
                top: 0;
                left: 0;
                right: 0;
                bottom: 0;
                background-color: rgba(0,0,0,.3)
            }

            .help_panel {
                z-index: 8;
                display: block;
                position: absolute;
                overflow-wrap: break-word;
                visibility: hidden;
                overflow-y: auto;
                overflow-x: hidden;
                top: 50px;
                left: 25vw;
                width: 50vw;
                max-height: 80%;
                padding-bottom: 10px;
                background-color: #dbdbdb;
                box-shadow: 0 0 20px 5px rgba(0,0,0,.6)
            }

            .help_title {
                padding-top: 5px;
                padding-left: 5px;
                font-weight: 700;
                text-decoration: underline
            }

            .help_method {
                padding-top: 20px;
                padding-left: 5px;
                font-weight: 700
            }

            .help_purpose {
                padding-top: 10px;
                padding-left: 15px
            }

            .help_detail {
                padding-top: 10px;
                padding-left: 35px
            }
        </style>
    </head>
    <body>
        <canvas id="canvas"></canvas>
        <div id="STRUCTURE_PANEL" class="structure_panel"></div>
        <div id="PROPERTY_PANEL" class="property_panel"></div>
        <input type="button" id="CLIP_BTN_ONOFF" class="clip_btn_onoff">
        <input type="button" id="CLIP_BTN_FRONT" class="clip_btn_front">
        <input type="button" id="CLIP_BTN_SIDE" class="clip_btn_side">
        <input type="button" id="CLIP_BTN_TOP" class="clip_btn_top">
        <input type="range" id="CLIP_SLIDEBAR" aria-label="slidebar" class="clip_slidebar">
        <div class="loading">
            <span class="spinner"></span>
        </div>
        <div class="appname"></div>
        <div id="HELP_BUTTON" class="help_button"></div>
        <div id="HELP_BACKGROUND" class="help_background"></div>
        <div id="HELP_PANEL" class="help_panel"></div>
